import React from 'react'

export default function Accordion(props) {
    const recipes = props.recipes

    return (
       <div>
        <ul className="accordion" data-accordion>
        {recipes.map(recipe => {
            return ( 
                <li className="accordion-item" key={recipe.key} data-accordion-item data-allow-all-closed="true">
                  <a href="#" className="accordion-title">{recipe.name}</a>
                  <div className="accordion-content" data-tab-content>
                    <p>{recipe.body}</p>

                  </div>
                </li>
              )})}
            </ul>
        </div>
    )
}
